import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const items = [];

	pets.map((pet, i) => {
		for (const [index, value] of images.entries()) {
    	if (images[index].pets_id === pets[i].id) {
	     	var url = images[index].url; 
	  		items.push(<Card key={pets[i].id} img={'http//http://localhost:4412/api/file/' + url} name={pets[i].name} description={pets[i].description}/>);
  		}
  	}
	})

	return (
		<div>
			{items}
		</div>
	);
}

export default CardList;

